import React, { Component } from 'react'
import {Form, FormGroup, Label, Input} from 'reactstrap'

export default class WordForm extends Component {
    render() {
        return (
            <div>
                <Form>
                    <FormGroup>
                        <Label>Keyword: </Label>
                        <Input type='text' name='keyword' id='keyword' placholder='Enter keyword...'></Input>
                    </FormGroup>
                </Form>
            </div>
        )
    }
}
